import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';

export default function GameInfoPage() {
  return (
    <Container>
      <Row>
        <Col lg={2} className="about-game">
          About Game
        </Col>
        <Col lg={10}>
          <Row>
            <Col>Developer</Col>
            <Col>Publisher</Col>
            <Col>one</Col>
          </Row>
        </Col>
      </Row>
    </Container>
  );
}
